import { createIconSet } from '@expo/vector-icons';
const glyphMap = require(`../../assets/fonts/remixicon.glyph.json`);

const RemixIcon = createIconSet(glyphMap, 'RemixIcon', 'remixicon.ttf');

export default RemixIcon;
